const ActivityCommentSection = () => {
  return (
  <section>
    <CommentInputWrap>
        <CommentInput />
        <CommentWriteBtn>댓글달기</CommentWriteBtn>
    </CommentInputWrap>
    <CommentListWrap>
        <CommentItem>
            <CommentHeader></CommentHeader>
        </CommentItem>
    </CommentListWrap>
    </section>
    );
};

export default ActivityCommentSection;
